import React, { Component } from "react";
import { Route, Router, Switch } from "react-router-dom";
import "./index.css";
import "./App.scss";
import Dashboard from "./Main-pages/Dashbaord";

class App extends Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path="/dashboard" exact component={Dashboard} />
        </Switch>
      </Router>
    );
  }
}

export default App;
